import { useSelector } from "react-redux";




function Cart() {

    let a = useSelector((state) => {
        return state
    }) // redux store 가져와줌
    console.log(a.shoppingBasket);
    let getBasket = a.shoppingBasket;

    return (
        <div>
            <Table>
                <thead>
                    <tr>
                    <th>getBasket</th>
                    <th>상품명</th>
                    <th>수량</th>
                    <th>변경하기</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                    <td>1</td>
                    <td>안녕</td>
                    <td>안녕</td>
                    <td>안녕</td>
                    </tr>
                </tbody>
            </Table> 
        </div>
    )
}

export default Cart;
